INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, '<div class="page-wrapper">\r\n  <div class="banner">\r\n  <div class="wrapper">\r\n    <h1>Sharing Ideas For Charities</h1>\r\n    <h2>Many charities’ goals are similar, as is the functionality we require, but little<br />shared working takes place.</h2>\r\n    <p>By working together, driving shared areas of interest and influencing open source<br />developments we can bring efficiencies, improve the digital experience for our users, and<br />have great impact.</p>\r\n    <h2>Together we can make a bigger diference.</h2>\r\n  </div>\r\n  </div>\r\n  <div class="middle">\r\n  <div class="h_register">\r\n    <div class="wrapper">\r\n      <div class="register_left">\r\n        <div class="event_detail">\r\n          <h1>Next Event: <span>June 23<span>th</span> 2016 18:30-21:00</span></h1>\r\n        </div>\r\n        <div class="event_place clearboth">Cancer Research UK, Angel Building, 407 St John Street, London EC1V 4AD</div>\r\n      </div>\r\n      <div class="register_right"><a href="#" class="register_btn">Register</a></div>\r\n    </div>\r\n  </div>\r\n  <div class="involved">\r\n    <div class="wrapper">\r\n      <h1>Get Involved</h1>\r\n      <div class="involved_detail">\r\n          <div class="involved_part">\r\n              <div class="symbol"><img src="images/meetings.png"  /></div>\r\n              <h2>We Do Meetings</h2>\r\n              <p>We organise our meetings through the OpenCharity MeetUp group</p>\r\n              <div class="part_btn"><a href="#" class="bodr_btn">Meetup Group</a></div>\r\n          </div>\r\n          <div class="involved_part">\r\n              <div class="symbol"><img src="images/collaborate.png"  /></div>\r\n              <h2>We Collaborate</h2>\r\n              <p>OpenCharity have a slack group for daily collaboration</p>\r\n              <div class="part_btn"><a href="#" class="bodr_btn">Slack Group</a></div>\r\n          </div>\r\n          <div class="involved_part">\r\n              <div class="symbol"><img src="images/share.png"  /></div>\r\n              <h2>We Share</h2>\r\n              <p>We have a Google Group set up to share tools and documents</p>\r\n              <div class="part_btn"><a href="#" class="bodr_btn">Google Group</a></div>\r\n          </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class="mission_member">\r\n    <div class="wrapper">\r\n      <div class="mission">\r\n      <h1>Our Mission</h1>\r\n      <h4>Charities and Partners collaborating and sharing open solutions and ideas to create value in the digital space.</h4>\r\n      <h5>If you are a charity or a supplier, we are ready to welcome you.</h5>\r\n      <div class="mission_detail">\r\n          <div class="mission_part">\r\n              <div class="symbol"><span><img src="images/bulb.png"  /></span></div>\r\n              <h2>We help charities</h2>\r\n              <p>share knowledge and working practice to make the best technology choices.</p>\r\n          </div>\r\n          <div class="mission_part">\r\n              <div class="symbol"><span><img src="images/together.png"  /></span></div>\r\n              <h2>We bring together</h2>\r\n              <p>charities and suppliers to the charity sector to share best practices.</p>\r\n          </div>\r\n          <div class="mission_part">\r\n              <div class="symbol"><span><img src="images/like.png"  /></span></div>\r\n              <h2>We encourage</h2>\r\n              <p>collaboration and innovation for the good of the charity sector.</p>\r\n          </div>\r\n      </div>\r\n      </div>\r\n      <div class="member">\r\n      <h1>Our Members</h1>\r\n      <div class="memberlogo">\r\n          <div class="span12">\r\n              <div id="owl-demo" class="owl-carousel">\r\n                <div class="item"><span><img src="images/memberlogo1.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo2.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo3.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo4.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo5.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo1.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo2.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo3.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo1.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo2.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo3.png" /></span></div>\r\n                <div class="item"><span><img src="images/memberlogo4.png" /></span></div>\r\n              </div>\r\n            </div>\r\n      </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  <div class="blog">\r\n    <div class="wrapper">\r\n    	<h1>Blog</h1>\r\n        <div class="blod_detail">\r\n        	<div id="demo">\r\n                <div id="owl-demo2" class="owl-carousel">\r\n                  <div class="item">\r\n                  	<h2>Online Donations Special...</h2>\r\n                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>\r\n                    <h3>14 Nov 2014</h3>\r\n                  </div>\r\n                  <div class="item">\r\n                  	<h2>Online Donations Special...</h2>\r\n                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>\r\n                    <h3>14 Nov 2014</h3>\r\n                  </div>\r\n                  <div class="item">\r\n                  	<h2>Online Donations Special...</h2>\r\n                    <p>Lorem ipsum dolor sit amet